import React from "react";
import styled from "styled-components";

const Banner = () => {
  const StyledDiv = styled.div`
  backgroundColor: "#0872fc",
        width: "auto",
        height: "200px",

        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        fontSize: "4rem",
        color: "white",
        paddingTop: "3rem",
        fontFamily: "Varela Round, sans-serif",
  `;
  return (
    <div
      className="banner"
      style={{
        backgroundColor: "#0872fc",
        width: "auto",
        height: "200px",

        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        fontSize: "4rem",
        color: "white",
        paddingTop: "3rem",
        fontFamily: "Varela Round, sans-serif",
      }}
    >
      <b>Employees</b>
    </div>
  );
};

export default Banner;
